webpackJsonp([0xabdb0eb3a41e],{430:function(e,a){e.exports={data:{markdownRemark:{html:'<blockquote>\n<p>Virginia Satir says that we can learn something new anytime we believe we can.\nTherefore we can learn to cope with what we are dealing with by readjusting the way\nwe think.</p>\n</blockquote>\n<p>In the <a href="/blog/rewire-your-brain-4/">part 4</a>, Survival Rules, we look at how we can identify childhood\nsurvival rules, analyze them and decide if they are beneficial today.\nChanging them is an interesting way of rewiring your brain as we change\nold behaviors as these rules no longer apply to the current day.</p>\n<hr>\n<p>This model was developed by the "Mother of Family Therapy": Virginia Satir\n<sup id="footnote-1"><a href="#footnote-1-ref">1</a></sup>. It can improve your life\nby <strong>transforming the way you see and express yourself</strong>\n<sup id="footnote-2"><a href="#footnote-2-ref">2</a></sup>.</p>\n<p>This model shows how you will predictably move through different stages\nas you cope with unexpected and significant or major changes\n<sup id="footnote-3"><a href="#footnote-3-ref">3</a></sup>.</p>\n<p>It also describes the effects each stage has on your feelings, thinking,\nperformance and physiology. The principles in this model can help you\nimprove how you process change <sup id="footnote-2"><a href="#footnote-2-ref">2</a></sup>.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/satir-change-graph-d3b43616a3c4518127f55b287042f8c3-c184d.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 665px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 64.06015037593986%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Graph"\n        title="Virginia Satir Change Curve"\n        src="/static/satir-change-graph-d3b43616a3c4518127f55b287042f8c3-c184d.png"\n        srcset="/static/satir-change-graph-d3b43616a3c4518127f55b287042f8c3-fb521.png 173w,\n/static/satir-change-graph-d3b43616a3c4518127f55b287042f8c3-b50d0.png 345w,\n/static/satir-change-graph-d3b43616a3c4518127f55b287042f8c3-c184d.png 665w"\n        sizes="(max-width: 665px) 100vw, 665px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n<em>Source of image: <a href="https://www.flickr.com/photos/jurgenappelo/5201852636">Flicker</a>. This illustration is adapted from the book <a href="http://www.management30.com">Management 3.0</a>.</em></p>\n<blockquote>\n<p>Life is not what it\'s supposed to be. It\'s what it is.\nThe way you cope with it is what makes the difference. ~ Virginia Satir</p>\n</blockquote>\n<h2 id="the-late-status-quo"><a href="#the-late-status-quo" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>The Late Status Quo</h2>\n<p>This stage describes your ordinary day-to-day. Although your feelings can\nfluctuate you are still in familiar territory like pieces of a puzzle fitting\ntogether. You are used to how things work and flow in this stage.</p>\n<p>Emotions may be fluctuating from comfort, contentment, happiness, excitement,\nto discomfort, dissatisfaction, unhappiness and depression or anxiousness.</p>\n<h2 id="the-foreign-element"><a href="#the-foreign-element" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>The Foreign Element</h2>\n<p>All of a sudden something needs to change. Your expectations are challenged.\nYour familiarity is now shaken up due to unexpected information, a\nsignificant event, invalidated assumptions or maybe the realization that\nsomething you have been doing your whole life needs to change.</p>\n<h2 id="chaos"><a href="#chaos" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Chaos</h2>\n<p>Now you are outside your comfort zone in a big unknown mysterious place. You\nare in an unpredictable unfamiliar territory. This can be very scary by\nalso offer some creativity.</p>\n<p>So it may feel unsafe. You may feel strong emotions which may confuse you:</p>\n<ul>\n<li>Stress</li>\n<li>Confusion</li>\n<li>Discomfort</li>\n<li>Pain</li>\n<li>Fear</li>\n<li>Excitement</li>\n<li>Euphoria</li>\n<li>Strong sense of urgency</li>\n</ul>\n<p>You could behave in ways that are unfamiliar to you:</p>\n<ul>\n<li>Trying to stay in control</li>\n<li>Disengaging and retreating to some familiar activity</li>\n<li>Focusing on one small part of the problem</li>\n<li>Ignoring the chaos happening around you</li>\n<li>Scrambling to find information about what is going on</li>\n</ul>\n<p>This stage is vital to the transformation process so acknowledge your feelings\nand build and use support systems. It can be very creative and a lot of ideas\ncan be generated here.</p>\n<h2 id="the-transforming-idea"><a href="#the-transforming-idea" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>The Transforming Idea</h2>\n<p>A powerful idea generated in the Chaos stage could lead to the transformation\nprocess which sheds light on the change and helps you understand it more\nand cope with it. This is the AHA! moment.</p>\n<p>You may not know it is a transforming idea so just try it and see what happens.\nIf it\'s not, try something other AHA!</p>\n<h2 id="practice-and-integration"><a href="#practice-and-integration" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Practice and Integration</h2>\n<p>The more you practice this new behavior extracted from your transforming idea\nthe more you integrate it into your life. It is a learning phase that allows for\nmistakes so your progress may ebb and flow.</p>\n<p>You have the opportunity to decide what is working and what isn\'t which makes\nyou more skilled and hopeful as you continuously learn.</p>\n<h2 id="the-new-status-quo"><a href="#the-new-status-quo" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>The New Status Quo</h2>\n<p>Once you have fully absorbed the change you become more healthier, calmer and\nalert. You need to continue feeling safe in this space by practicing.</p>\n<p>Emery sums it up elegantly by saying that:</p>\n<ul>\n<li>You feel good about how rapidly you are learning.</li>\n<li>You turn your attention toward other important areas of your life, armed with\nnew skills, knowledge and confidence.</li>\n<li>Eventually these new skills become second nature.</li>\n<li>Your learnings become assumptions and expectations.</li>\n<li>With time, the newness fades, and the New Status Quo becomes a Late Status Quo.</li>\n<li>And the change cycle begins again.</li>\n</ul>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/satir-change-model-cycle-5d18aff56638fb1662644a24cd062611-5ceab.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 670px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 85.67164179104478%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Cycle"\n        title="The Satir Change Process Model Cycle"\n        src="/static/satir-change-model-cycle-5d18aff56638fb1662644a24cd062611-5ceab.png"\n        srcset="/static/satir-change-model-cycle-5d18aff56638fb1662644a24cd062611-7f516.png 173w,\n/static/satir-change-model-cycle-5d18aff56638fb1662644a24cd062611-9d3b1.png 345w,\n/static/satir-change-model-cycle-5d18aff56638fb1662644a24cd062611-5ceab.png 670w"\n        sizes="(max-width: 670px) 100vw, 670px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    \n<em>Source of image: Corporate Programmer</em></p>\n<h2 id="my-final-thoughts"><a href="#my-final-thoughts" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>My final thoughts</h2>\n<p>This model can be used for any self-improvement need. Instead of tracking performance,\nyou could be tracking quality of life over time. Our survival rules are deeply\ningrained into us and we can pinpoint them, analyze them and decide if we still\nneed it or not. If we don\'t need it, we can change it and this is just one model\nof how we can do so through reflection.</p>\n<p>We don\'t want behaviors that cause:</p>\n<ul>\n<li>Exhaustion</li>\n<li>Misery</li>\n<li>Lack of focus and concentration</li>\n<li>Lack of self-care</li>\n<li>Lack of social interaction</li>\n<li>Lack of physical activity</li>\n<li>Problems with relationships</li>\n<li>Impending burn-out</li>\n</ul>\n<p>There is a lot of material out there describing the model in detail. I just\nwanted to document the idea as a model to help rewire the brain to transform  unhealthy behaviors to more positive behaviors. These stages show how a change\ncan impact us and how we can get to a point where we can thrive.</p>\n<hr>\n<h2 id="references"><a href="#references" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>References</h2>\n<ol>\n<li>\n<p><a id="footnote-1-ref"></a><a href="https://en.wikipedia.org/wiki/Virginia_Satir">Virginia Satir</a>, Wikipedia (<a href="#footnote-1">Navigate back</a>)</p>\n</li>\n<li>\n<p><a id="footnote-2-ref"></a><a href="http://stevenmsmith.com/ar-satir-change-model/">The Satir Change Model</a>,\nSteven M. Smith, Accelerating Team Productivity (<a href="#footnote-2">Navigate back</a>)</p>\n</li>\n<li>\n<p><a id="footnote-3-ref"></a><a href="http://dhemery.com/articles/managing_yourself_through_change/">Managing Yourself Through Change</a>,\nDale H. Emery, Consultant to Software Teams and Leaders (<a href="#footnote-3">Navigate back</a>)</p>\n</li>\n</ol>\n<h3 id="resources"><a href="#resources" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Resources</h3>\n<ul>\n<li>\n<p><a href="http://www.billsynnotandassociates.com.au/kb/257-framework-59-virginia-satir-change-process.html">Framework 59 Virginia Satir Change Process</a>,\nOrganisational Change Management Volume 1, Bill Synnot and Associates</p>\n</li>\n<li>\n<p><a href="https://www.flickr.com/photos/jurgenappelo/5201852636">Virginia Satir Change Curve</a>,\nFlicker, Jurgen Appelo says this illustration is part of the book <a href="http://www.management30.com">Management 3.0</a></p>\n</li>\n<li>\n<p><a href="http://10minutehr.com/2013/11/11/chaos-in-the-organisational-change-process-dont-try-to-avoid-it-manage-it/">Chaos during change – don’t try to avoid it, manage it</a></p>\n</li>\n<li>\n<p><a href="https://www.stickyminds.com/article/you-cant-fight-change">You Can\'t Fight Change</a></p>\n</li>\n<li>\n<p><a href="http://www.hypnosisrapport.com/stress-is-needed-for-success-in-nyc/">Stress Is Needed For Success In NYC</a></p>\n</li>\n<li>\n<p><a href="http://agileconsulting.blogspot.co.za/">Think Visually When Building an Agile Enterprise Change Plan</a></p>\n</li>\n</ul>\n<div>Icons made by <a href="http://www.freepik.com" title="Freepik">Freepik</a> from <a href="http://www.flaticon.com" title="Flaticon">www.flaticon.com</a> is licensed by <a href="http://creativecommons.org/licenses/by/3.0/" title="Creative Commons BY 3.0" target="\\_blank">CC 3.0 BY</a></div>',timeToRead:5,excerpt:"Virginia Satir says that we can learn something new anytime we believe we can.\nTherefore we can learn to cope with what we are dealing with…",frontmatter:{title:"Rewire your brain (Part 5) - The Satir Change Process Model",cover:"https://picsum.photos/1280/500/?image=874",date:"2017-06-25 22:02:42 +0200",category:null,tags:["Mindset","Productivity"]},fields:{slug:"/blog/rewire-your-brain-5"}},prev:{excerpt:"Lara Boyd challenges us by asking how do we learn? And why does some of \nus learn things more easily than others…",frontmatter:{title:"Rewire your brain (Part 6) - Neuroplasticity",cover:"https://picsum.photos/1280/500/?image=821",date:"2017-06-26 19:05:39 +0200"},fields:{slug:"/blog/rewire-your-brain-6"}},next:{excerpt:"Virginia Satir says that you have learned what you have learned very well.\nIt has helped you survive. In  Part…",frontmatter:{title:"Rewire your brain (Part 4) - Childhood survival rules",cover:"https://picsum.photos/1280/500/?image=889",date:"2017-06-24 20:35:14 +0200"},fields:{slug:"/blog/rewire-your-brain-4"}}},pathContext:{slug:"/blog/rewire-your-brain-5",total:57,prev:"/blog/rewire-your-brain-6",next:"/blog/rewire-your-brain-4"}}}});
